import "./about.scss"
import YoutubeBackground from 'react-youtube-background'

export default function About(){

const videoURL = "https://file-examples-com.github.io/uploads/2017/04/file_example_MP4_480_1_5MG.mp4"

    return(
        <div className = "about" id = "about">
        <iframe
            width = {1920}
            height = {1090}
            src = "https://www.youtube.com/embed/ScTkEsOKfvg?autoplay=1&controls=0&mute=1&loop=1&modestbranding=1&showinfo=0&start=50&enablejsapi=1&&widgetid=3"
            title = "Youtuber"
            frameBoarder = "0"
            allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"/>
        </div>
    )
}
